import React, { Component } from "react";
import withStyles from "@material-ui/core/styles/withStyles";

const styles = {};
class Lgin extends Component {
  render() {
    return (
      <div>
        <h1>Login Page</h1>
      </div>
    );
  }
}

export default withStyles(styles)(login);
